import React, { Component } from 'react'
import WeatherService from '../service/WeatherService';

class WeatherListComponent extends Component {
    constructor(props) {
        super(props)
        this.state = {
            weathers: [],
            isAscending: true,
            filters: []
        }
    }

    componentDidMount() {
        this.refreshWeathers();
    }

    refreshWeathers(sortBy, isAscending, filterOperator, weathers) {
        console.log(isAscending + " " +  this.state.isAscending)
        // console.log("filters: " + " " +  filters)

        WeatherService.retrieveAllWeathers(sortBy, isAscending, this.state.filters, filterOperator, weathers)
            .then(
                response => {
                    console.log("response headers: " + JSON.stringify(response.headers));

                    this.setState({ weathers: response.data })
                    console.log("response data: " + JSON.stringify(response.data));

                }
            ).then( () => {if (sortBy) this.setState({isAscending : !isAscending})})
    }

   filters() {
        return (<div className="row">
        {<textarea placeholder= "Id" onBlur= {event => { if (event){ this.state.filters.push({"id": event.target.value}); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "eq", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "City name" onBlur= {event => { if (event){this.state.filters.push({"id": event.target.value}); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "eq", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Country" onBlur= {event => { if (event){ this.state.filters.push({"country": event.target.value}); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "eq", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Latitude smaller than" onBlur= {event => { if (event) {this.state.filters.push( {"lat": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "lte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Latitude bigger than" onBlur= {event => { if (event) {this.state.filters.push( {"lat": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "gte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Longitude smaller than" onBlur= {event => { if (event) {this.state.filters.push( {"lon": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "lte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Longitude bigger than" onBlur= {event => { if (event) {this.state.filters.push( {"lon": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "gte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Humidity smaller than" onBlur= {event => { if (event) {this.state.filters.push( {"humidity": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "lte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Humidity bigger than" onBlur= {event => { if (event) {this.state.filters.push( {"humidity": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "gte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Feel temperature smaller than" onBlur= {event => { if (event) {this.state.filters.push( {"feels_like": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "lte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Feel temperature bigger than" onBlur= {event => { if (event) {this.state.filters.push( {"feels_like": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "gte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Temperature smaller than" onBlur= {event => { if (event) {this.state.filters.push( {"temp": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "lte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Temperature bigger than" onBlur= {event => { if (event) {this.state.filters.push( {"temp": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "gte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Temperature max smaller than" onBlur= {event => { if (event) {this.state.filters.push( {"temp_max": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "lte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Temperature max bigger than" onBlur= {event => { if (event) {this.state.filters.push( {"temp_max": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "gte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Temperature min smaller than" onBlur= {event => { if (event) {this.state.filters.push( {"temp_min": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "lte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Temperature min bigger than" onBlur= {event => { if (event) {this.state.filters.push( {"temp_min": event.target.value},); this.refreshWeathers(this.state.sortBy, this.state.isAscending, "gte", this.state.weathers)}}}></textarea>}
        {<textarea placeholder= "Description" onBlur= {event => { if (event) { this.state.push({"description": event.target.value}); this.refreshWeathers( this.state.sortBy, this.state.isAscending,  "eq", this.state.weathers)}}}></textarea>}
    </div>)
   }

   header(){
       return (<thead>
       <tr>
           <th onClick={() =>this.refreshWeathers("id", this.state.isAscending, '', this.state.weathers) }>cityId</th>
           <th onClick={() =>this.refreshWeathers("name", this.state.isAscending, '', this.state.weathers) }>city Name</th>
           <th onClick={() =>this.refreshWeathers("coord.lat", this.state.isAscending, '', this.state.weathers) }>latitude</th>
           <th onClick={() =>this.refreshWeathers("coord.lon", this.state.isAscending, '', this.state.weathers) }>longitude</th>
           <th onClick={() =>this.refreshWeathers("sys.country", this.state.isAscending, '', this.state.weathers) }>country</th>
           <th onClick={() =>this.refreshWeathers("weatherMain.humidity", this.state.isAscending, '', this.state.weathers) }>humidity</th>
           <th onClick={() =>this.refreshWeathers("weatherMain.feels_like", this.state.isAscending, '', this.state.weathers) }>feels like</th>
           <th onClick={() =>this.refreshWeathers("weatherMain.temp", this.state.isAscending, '', this.state.weathers) }>temperature</th>
           <th onClick={() =>this.refreshWeathers("weatherMain.temp_max", this.state.isAscending, '', this.state.weathers) }>maximum temperature</th>
           <th onClick={() =>this.refreshWeathers("weatherMain.temp_min", this.state.isAscending, '', this.state.weathers) }>minimal temperature</th>
           <th onClick={() =>this.refreshWeathers("description", this.state.isAscending, '', this.state.weathers) }>description</th>                                
       </tr>
   </thead>)
   }

   mainBody(){
    return (

    <tbody>
        {
            this.state.weathers.map(
                weather =>
                    <tr key={weather.id}>
                        <td>{weather.id}</td>
                        <td>{weather.name}</td>
                        <td>{weather.coord.lat}</td>
                        <td>{weather.coord.lon}</td>
                        <td>{weather.sys.country}</td>
                        <td>{weather.weatherMain.humidity}</td>
                        <td>{weather.weatherMain.feels_like}</td>
                        <td>{weather.weatherMain.temp}</td>
